import React from 'react';

const HomePage = () => {
  return (
    <div className="home-page">
      <h1>Welcome to my App</h1>
      <p>This is a sample home page for my app.</p>
      <p>Please choose an option from the menu to get started.</p>
    </div>
  );
}

export default HomePage;
